import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import NavDropdown from 'react-bootstrap/NavDropdown';
import {Button} from "react-bootstrap";
import React from "react";

export default class NavBarHome extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
        }
        this.bind();
    };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render (){
        return (
            <><div className="position-fixed">
                <Navbar  style={{backgroundColor: "#C7EECC"}}>
                        <Navbar.Brand style={{marginLeft:"20px"}} href="https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0">
                            Dr. Leonardo Simões <br/>
                            Nutrição Clínica e Esportiva
                        </Navbar.Brand>
                        <Navbar.Collapse className='d-flex justify-content-between'>
                            <Nav>
                                <Nav.Link href="#home">Sobre Leonardo</Nav.Link>
                                <Nav.Link href="#home">Serviços Oferecidos</Nav.Link>
                                <Nav.Link href="#home">Planos</Nav.Link>
                                <Nav.Link href="#link">Contato</Nav.Link>
                            </Nav>
                            <Button className="btn-success" onClick={() => this.redirectFromWhats()}>
                                <i className="bi bi-whatsapp"></i>
                                Agendar consulta
                            </Button>
                        </Navbar.Collapse>
                </Navbar>
            </div>
            </>
    );
}
}
